import Header from "../Header";
import "./index.css";
const Home = () => {
  return (
    <>
      <Header />
      <div>
        <div>
          <div>
            <button type="button">Zig Zag English Alphabets</button>
          </div>
          <div>
            <button type="button">Zig Zag English Words</button>
          </div>
          <div>
            <button type="button">English Synonyms</button>
          </div>
          <div>
            <button type="button">English Antonyms</button>
          </div>
        </div>
      </div>
    </>
  );
};
export default Home;
